import React from 'react'
import appProp from '../application'
import '../styles/LandingPage.css';

function LandingPage() {
    return (
        <div className='landing-page'>
            <h2>Welcome User</h2>
            <h1>Profiler 1.0</h1>
            <span>Make your interactive profile</span>
            <br />
            <span>Follow <a href={appProp.swagger_base_url}>{appProp.swagger_base_url}</a> to create your profile</span>
            <span>Access {appProp.server + '/<email-id>'} to view your profile</span>
        </div>
    )
}

export default LandingPage
